def _preprocess_numpy_input(x, data_format, mode):
    if mode == 'tf':
        return ((x / 255) - 0.5) * 2

    if mode == 'torch':
        x /= 255.
        mean = [0.485, 0.456, 0.406]
        std = [0.229, 0.224, 0.225]
        for i in range(3):
            x[..., i] -= mean[i]
            x[..., i] /= std[i]
        return x

    if data_format == 'channels_first':
        if x.ndim == 3:
            if mode != 'tf':  # 'RGB'->'BGR'
                x = x[:, ::-1, ...]
            else:
                x = x[::-1, ...]
        else:
            if mode != 'tf':  # 'RGB'->'BGR'
                x = x[:, :, ::-1, ...]
            else:
                x = x[:, ::-1, ...]
    else:
        if mode != 'tf':  # 'RGB'->'BGR'
            x = x[..., ::-1]

    if mode != 'tf':
        mean = [103.939, 116.779, 123.68]
        for i in range(3):
            x[..., i] -= mean[i]

    return x
